import React, { Component } from 'react';
import Card from './Card';

class CardList extends Component {
	render() {
		return (
			<div>
				<Card id={this.robots[0].id} name={this.robots[0].name} email={this.robots[0].email}/>
				<Card id={this.robots[1].id} name={this.robots[1].name} email={this.robots[1].email}/>
				<Card id={this.robots[2].id} name={this.robots[2].name} email={this.robots[2].email} />
			</div>
		);
	}
}

export default CardList;
